import Image from "next/image"
import Link from "next/link"

const ShopPage = async () => {
    return (
        <main>
            <div className="max-w-screen-lg mx-auto my-8">
                <h1 className="font-bold text-xl">Meme for sale</h1>
                <p>Buy a meme and get a meme.</p>

                <section className="flex flex-col my-4">
                    <div className="w-fit">
                        <Image src='data:image/jpeg;base64,'
                       className="rounded" alt='Blue Dog' height={300} width={200}  />
                       <p className="my-2">This is fine.</p>
                       <Link className="hover:underline font-extrabold" href='/checkout'>👉 Buy Now! 👈</Link>
                    </div>
                </section>
            </div>
        </main>
    )
}

export default ShopPage